import React from "react";
import { connect } from "react-redux";

const techCard = ({tech:{techs}}) => {
    console.log(techs)
  return (
    <div id="tech-profile-modal" className="modal">
      <div id="tech-profile-modal" className="modal-content center">
        <div className="card large">
          <div
            className="card-image waves-effect waves-block waves-light"
            style={{
              top: "15px",
              left: "200px",
              width: 250,
              height: 250,
              borderRadius: "50%",
            }}
          >
            <img
              src={
                "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTw92ToLJnjnUmsEbTRFStNtKCD-PJBRbnqYg&usqp=CAU"
              }
              className="activator"
              alt="ProfilePic"
            />
          </div>
          <div class="card-content">

           Name

          </div>
          <div class="card-reveal">
            <span class="card-title grey-text text-darken-4">
              Card Title<i class="material-icons right">close</i>
            </span>
            <p>
              Here is some more information about this card that is only
              revealed once clicked on.
            </p>
          </div>
        </div>
      </div>
      <div className="modal-footer">
        <a href="#!" className="modal-close waves-effect red btn">
          Go Back
        </a>
      </div>
    </div>
  );
};


const mapStateToProps = state =>({
    current:state.tech.current
  })

export default connect()( techCard);
